{"id": 194677749, "url": "https://api.github.com/repos/saltstack/salt/issues/38184", "body": "### Description of Issue/Question
Current version of salt minion doen not support/returns FC HBA world wide port names as grains.
It is very useful if Salt will support this grains data.

For my personal purpose I wrote user grains module (require pyudev package):
```
def _my_custom_grain():
     from pyudev import Context
     context = Context()
     pn = {}
     for device in context.list_devices(subsystem='fc_host'):
         pn[device.sys_name] = device.attributes.asstring('port_name')
     return pn

def main():
     # initialize a grains dictionary
     grains = {}
     grains['port_name_fc_hosts'] = _my_custom_grain()
     return grains
```

It would be great if the module becomes a part of the Salt.", "user": {"id": 15701425, "url": "https://api.github.com/users/alexminder", "type": "User", "login": "alexminder", "node_id": "MDQ6VXNlcjE1NzAxNDI1", "html_url": "https://github.com/alexminder", "gists_url": "https://api.github.com/users/alexminder/gists{/gist_id}", "repos_url": "https://api.github.com/users/alexminder/repos", "avatar_url": "https://avatars.githubusercontent.com/u/15701425?v=4", "events_url": "https://api.github.com/users/alexminder/events{/privacy}", "site_admin": false, "gravatar_id": "", "starred_url": "https://api.github.com/users/alexminder/starred{/owner}{/repo}", "followers_url": "https://api.github.com/users/alexminder/followers", "following_url": "https://api.github.com/users/alexminder/following{/other_user}", "organizations_url": "https://api.github.com/users/alexminder/orgs", "subscriptions_url": "https://api.github.com/users/alexminder/subscriptions", "received_events_url": "https://api.github.com/users/alexminder/received_events"}, "state": "closed", "title": "Fiber Channel HBA world wide port name Grains", "labels": [{"id": 204655, "url": "https://api.github.com/repos/saltstack/salt/labels/Feature", "name": "Feature", "color": "009800", "default": false, "node_id": "MDU6TGFiZWwyMDQ2NTU=", "description": "new functionality including changes to functionality and code refactors, etc."}, {"id": 194768064, "url": "https://api.github.com/repos/saltstack/salt/labels/Platform", "name": "Platform", "color": "fef2c0", "default": false, "node_id": "MDU6TGFiZWwxOTQ3NjgwNjQ=", "description": "Relates to OS, containers, platform-based utilities like FS, system based apps"}, {"id": 604063979, "url": "https://api.github.com/repos/saltstack/salt/labels/stale", "name": "stale", "color": "ffffff", "default": false, "node_id": "MDU6TGFiZWw2MDQwNjM5Nzk=", "description": null}], "locked": false, "number": 38184, "node_id": "MDU6SXNzdWUxOTQ2Nzc3NDk=", "assignee": null, "comments": 2, "html_url": "